mapper.select:
select

from COMPONENT
where where ANALYSIS = #{analysis,jdbcType=VARCHAR}
and VERSION = #{version,jdbcType=DECIMAL}

select 

from COMPONENT
where ANALYSIS = #{analysis,jdbcType=VARCHAR}
  and NAME = #{name,jdbcType=VARCHAR}
  and VERSION = #{version,jdbcType=DECIMAL}

mapper.delete:
delete from COMPONENT
where ANALYSIS = #{analysis,jdbcType=VARCHAR}
  and NAME = #{name,jdbcType=VARCHAR}
  and VERSION = #{version,jdbcType=DECIMAL}
